import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <>
    <div className="passwordBox">
      <h2>Password Generator</h2>

      <div className='passwordIn'>
      <input type='text' readOnly></input><button>Copy</button>
      </div>
    </div>
    </>
  );
}

export default App;
